import React from "react";
import { useNavigate } from "react-router-dom";
import {
  FileText,
  FileSpreadsheet,
  Presentation,
  Image,
  File,
  Video,
  Upload,
  Bell,
} from "lucide-react";

const FilesPage: React.FC = () => {
  const navigate = useNavigate();

  const fileCategories = [
    {
      name: "Reports",
      count: 12,
      icon: <FileText className="w-10 h-10 text-blue-500 mb-3" />,
      color: "blue",
    },
    {
      name: "Spreadsheets",
      count: 8,
      icon: <FileSpreadsheet className="w-10 h-10 text-green-500 mb-3" />,
      color: "green",
    },
    {
      name: "Presentations",
      count: 5,
      icon: <Presentation className="w-10 h-10 text-purple-500 mb-3" />,
      color: "purple",
    },
    {
      name: "Images",
      count: 24,
      icon: <Image className="w-10 h-10 text-pink-500 mb-3" />,
      color: "pink",
    },
    {
      name: "PDFs",
      count: 10,
      icon: <File className="w-10 h-10 text-red-500 mb-3" />,
      color: "red",
    },
    {
      name: "Videos",
      count: 4,
      icon: <Video className="w-10 h-10 text-yellow-500 mb-3" />,
      color: "yellow",
    },
  ];

  return (
    <div className="min-h-screen bg-white text-gray-900 p-10 transition-all duration-300">
      {/* Header */}
      <header className="flex justify-between items-center mb-10">
        <h1 className="text-3xl font-bold">üìÅ Files</h1>

        <div className="flex items-center space-x-4">
          <button
            onClick={() => navigate("/files/upload")}
            className="flex items-center px-5 py-2.5 rounded-lg bg-blue-600 hover:bg-blue-700 text-white text-sm font-medium shadow-sm transition"
          >
            <Upload className="w-5 h-5 mr-2" /> Upload File
          </button>
          <div className="relative">
            <Bell className="w-5 h-5 text-gray-500 hover:text-blue-600 cursor-pointer transition" />
            <span className="absolute -top-2 -right-2 bg-red-500 text-white text-xs rounded-full px-1.5">
              3
            </span>
          </div>
        </div>
      </header>

      {/* File Category Grid */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {fileCategories.map((file, index) => (
          <div
            key={index}
            className="p-6 bg-white border border-gray-200 rounded-2xl shadow-sm hover:shadow-md transition cursor-pointer"
            onClick={() => alert(`Opening ${file.name} folder...`)}
          >
            {file.icon}
            <h2 className="font-semibold text-lg mb-1">{file.name}</h2>
            <p className="text-gray-500 text-sm">{file.count} files</p>
          </div>
        ))}
      </div>

      {/* Recent Uploads Section */}
      <div className="mt-12">
        <h2 className="text-xl font-semibold mb-4">Recent Uploads</h2>
        <div className="bg-gray-50 border border-gray-200 rounded-2xl shadow-sm p-6">
          <ul className="divide-y divide-gray-200">
            {[
              { name: "ProjectPlan.docx", type: "Document", date: "Oct 27, 2025" },
              { name: "Budget.xlsx", type: "Spreadsheet", date: "Oct 28, 2025" },
              { name: "TeamIntro.pptx", type: "Presentation", date: "Oct 29, 2025" },
            ].map((file, idx) => (
              <li
                key={idx}
                className="flex items-center justify-between py-3 hover:bg-white transition rounded-lg px-2"
              >
                <div>
                  <p className="font-medium">{file.name}</p>
                  <p className="text-sm text-gray-500">{file.type}</p>
                </div>
                <p className="text-sm text-gray-400">{file.date}</p>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default FilesPage;
